onClipEvent (load) {
	位移上速度 = 0;
	位移下速度 = 0;
	位移左速度 = 0;
	位移右速度 = 0;
	if (_parent._parent._x - _root.gameworld[_parent._parent.攻击目标]._x > 0)
	{
		位移左速度 = -18;
	}
	else
	{
		位移右速度 = -18;
	}
}
onClipEvent (enterFrame) {
	_parent.攻击时四向移动(位移上速度,位移下速度,位移左速度,位移右速度);
}

